import { Grid } from '@material-ui/core'
import React, { useEffect, useState } from 'react'


const Home = () => {
const [Notes, setNotes] = useState([])

useEffect(() => {
    fetch("http://localhost:8000/notes")
    .then(res =>res.json() )
    .then(data =>setNotes(data))
}, [])

return(

    <div>
<Grid >
        {Notes.map(note=>(

        <Grid key={note.id}>{note.title}</Grid>
        ))}


    </Grid>

    </div>
)


}

export default Home
